import { logDOM } from '@testing-library/dom';
import React from 'react';
import logo from './Images/img.png'

const Node = () => {
    return(
        <>
            <div className = 'image'>
                <img src = {require("./Images/img.png").default} alt = 'image'/>
            </div>
        </>
    );
}

export default Node;
